from math import prod
def psd(n): return prod(int(d)**2 for d in str(n) if d != "0")
def ok(n):
    seen = set()
    while n not in seen: # iterate until fixed point or in cycle
        seen.add(n)
        n = psd(n)
    return n == 1
def aupto(n): return [k for k in range(1, n+1) if ok(k)]
